import React from "react";
import Card from "./Card";
const List =()=>{
    return(
        <div className="bg-black mt-[-100px] " >
            <h1 className="text-xl mb-8 text-white font-semibold">Popular Movies</h1>
            <div className="flex">
                <Card/>
                <Card/>
                <Card/>
                <Card/>
            </div>
            
        </div>
    )
}
export default List
